import { Component } from '@angular/core';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css']
})
export class HomeComponent {

}
<app-header></app-header>
<img src="./../../../assets/home.png" alt="Beautiful valley full of grass, trees and other greenery"
  class="object-center h-72 w-full">
<h2 class="my-5 italic text-center">"Valley View Estates: Tranquil Living in the
  beautiful Qu'Apelle
  valley, 22 miles
  from Regina."</h2>
<div class="flex flex-row my-5 justify-around">
  <a href="#lots" class="button">View Lots</a>
  <a href="#about" class="link">Learn More ...</a>
</div>
